import logo from './logo.svg';
import './App.css';
import GraphLine from './components/GraphLine';

import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';



function App() {
  return (
    <div className="App">
      <GraphLine />
          </div>
  );
}

export default App;
